export default function Database() {

  return (
    <Grid container justifyContent="start" alignItems = "center" direction="column">
    <Button variant="contained" sx={{fontFamily: "Nunito", fontSize:"1.5rem"}} 
            onClick={() => window.open('https://rover-back-end-default-rtdb.europe-west1.firebasedatabase.app', '_blank')}>Database</Button>
            <Button variant="contained" startIcon={<BatteryCharging90Icon />} sx={{alignItems: 'center'}}>
            </Button>
    </Grid>
  )
}
